s4_M.UserData.seriesInfo = struct('seriesId','7027701','srCode','SR297453','country','China','seriesName','CN: Money Supply M2','nameLocal','','Unit','RMB bn','frequency','Monthly','source','The People"s Bank of China','firstObsDate','01/01/1997 00:00:00','LastObsDate','02/01/2021 00:00:00','multiplierCode','BN','tLastUpdTime','03/16/2021 08:23:08','seriesStatus','Active','remarks',['In January 2018, the PBoC improved the statistical method of money market funds in money supply and replaced money market fund deposits (including certificates of deposit) with money market funds held by non-depository institutions.','After the improvement, the current M2 balance expanded by 1.15 trillion yuan, while the M2 balance expanded by 824.9 billion yuan in the same period last year. The data was comparable. The current M2 balance increased by 8.6% over the same period of last year, and the M2 balance at the end of 2017 increased by 8.1% over the same period last year.','According to the statistics method before improvement, the M2 growth rate at the end of January 2018 was 8.5%.','','','2018年1月，人民银行完善货币供应量中货币市场基金部分的统计方法，用非存款机构部门持有的货币市场基金取代货币市场基金存款（含存单）。','完善后，本期M2余额扩大1.15万亿元，去年同期M2余额扩大8249亿元，数据可比；本期M2余额同比增长8.6%，2017年末M2余额同比增长8.1%。','按完善前方法统计，2018年1月末M2增速为8.5%。'],'functionInformation','""');
